
PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" varchar(255) NOT NULL);
CREATE TABLE "ks_users" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "url" varchar(255), "scraped" boolean);
CREATE TABLE "ks_projects" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "url" varchar(255), "backer_count" integer, "title" varchar(255), "creator_id" varchar(255), "parent_category" varchar(255), "category" varchar(255), "funding_goal" integer, "pledged" integer, "latitude" varchar(255), "longitude" varchar(255), "updates_count" integer, "comments_count" integer, "scraped" boolean, "description" varchar(255));
CREATE TABLE "ks_project_backers" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "ks_user_id" integer, "ks_project_id" integer);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
CREATE INDEX "index_ks_project_backers_on_ks_user_id" ON "ks_project_backers" ("ks_user_id");
CREATE INDEX "index_ks_project_backers_on_ks_project_id" ON "ks_project_backers" ("ks_project_id");
COMMIT;
